var exports = {};
var smallImages = document.querySelectorAll(".hero-right-image");
var image = document.querySelector(".hero-image");
var dots = document.querySelectorAll(".dots");
var galleryslide = document.querySelectorAll(".gallery-slides-lists-images");
smallImages.forEach(function (smallImage) {
    smallImage.addEventListener("click", function () {
        var smallImgSrc = smallImage.querySelector("img");
        var ImgSrc = image.querySelector("img");
        var tempImg = ImgSrc.src;
        var tempSmallImg = smallImgSrc.src;
        smallImage.removeChild(smallImage.firstElementChild);
        var imgElement = document.createElement('img');
        imgElement.src = tempImg;
        smallImage.appendChild(imgElement);
        image.removeChild(image.firstElementChild);
        imgElement = document.createElement('img');
        imgElement.src = tempSmallImg;
        image.appendChild(imgElement);
    });
});
dots.forEach(function (dot, index) {
    dot.addEventListener("click", function () {
        dots.forEach(function (dotTemp) {
            dotTemp.classList.remove("_active");
        });
        dot.classList.add("_active");
        galleryslide.forEach(function (slide) {
            slide.classList.remove("_active");
        });
        galleryslide[index].classList.add("_active");
    });
});


